    23, 2013. The data set provided by IDEM was in an ESRI geodatabase format and the
    feature class was named "STATE_CLEANUP." The following is excerpted from the metadata
    provided by IDEM, OLQ for the source shapefile STATE_CLEANUP: "State Cleanup sites
